import { motion } from 'framer-motion';
import React from 'react';
import { FaCode, FaGraduationCap, FaHeart, FaUser } from 'react-icons/fa';
import './About.css';

const About = () => {
  const aboutPoints = [
    {
      icon: FaUser,
      title: 'Who I Am',
      description: 'A passionate developer with a love for creating innovative solutions and learning new technologies.'
    },
    {
      icon: FaGraduationCap,
      title: 'Education',
      description: 'Bachelor\'s degree in Computer Science with continuous learning through online courses and projects.'
    },
    {
      icon: FaHeart,
      title: 'Passion',
      description: 'I love turning complex problems into simple, beautiful, and intuitive solutions.'
    },
    {
      icon: FaCode,
      title: 'Approach',
      description: 'Clean code, user experience, and performance are at the heart of everything I build.'
    }
  ];

  return (
    <section id="about" className="section about">
      <div className="container">
        <motion.h2 
          className="section-title"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          About Me
        </motion.h2>

        <motion.p 
          className="section-subtitle"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.2 }}
          viewport={{ once: true }}
        >
          Get to know me better and understand what drives me in the world of technology
        </motion.p>

        <div className="about-content">
          <motion.div 
            className="about-text"
            initial={{ opacity: 0, x: -50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.3 }}
            viewport={{ once: true }}
          >
            <h3>Hello! I'm Your Name</h3>
            <p>
              I'm a passionate and creative developer who loves building things that live on the internet. 
              My journey in web development started back in 2018 when I decided to try editing custom Tumblr themes â€” 
              turns out hacking together a custom reblog button taught me a lot about HTML & CSS!
            </p>
            <p>
              Fast-forward to today, and I've had the privilege of building software for an advertising agency, 
              a start-up, a huge corporation, and a student-led design studio. My main focus these days is 
              building accessible, inclusive products and digital experiences for a variety of clients.
            </p>
            <p>
              I also recently launched a course that covers everything you need to build a web app with 
              the Spotify API using Node & React.
            </p>
          </motion.div>

          <motion.div 
            className="about-stats"
            initial={{ opacity: 0, x: 50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
            viewport={{ once: true }}
          >
            <div className="stats-grid">
              <div className="stat-item">
                <div className="stat-number">3+</div>
                <div className="stat-label">Years Experience</div>
              </div>
              <div className="stat-item">
                <div className="stat-number">50+</div>
                <div className="stat-label">Projects Completed</div>
              </div>
              <div className="stat-item">
                <div className="stat-number">20+</div>
                <div className="stat-label">Happy Clients</div>
              </div>
              <div className="stat-item">
                <div className="stat-number">15+</div>
                <div className="stat-label">Technologies</div>
              </div>
            </div>
          </motion.div>
        </div>

        <motion.div 
          className="about-points"
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.5 }}
          viewport={{ once: true }}
        >
          <div className="points-grid">
            {aboutPoints.map((point, index) => (
              <motion.div 
                key={point.title}
                className="point-card"
                initial={{ opacity: 0, y: 30 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: 0.6 + index * 0.1 }}
                viewport={{ once: true }}
                whileHover={{ y: -10 }}
              >
                <div className="point-icon">
                  <point.icon />
                </div>
                <h4>{point.title}</h4>
                <p>{point.description}</p>
              </motion.div>
            ))}
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default About;
